import React from "react";
import Home from "./pages/Home";
import axios from "axios";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
//the 'useState' hook allows us to create variables that can hold data and be updated overtime
function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path="/" exact to="Home" />
        </Switch>
      </Router>
    </div>
  );
}
export default App;
